import { lazy } from 'react';

export const routes = [
  {
    name: 'Dashboard',
    route: '/',
    component: lazy(() => import('../containers/home'))
  },
  {
    name: 'Profile',
    route: '/profile',
    component: lazy(() => import('../containers/home'))
  }
]
